SELECT [Time_Lookup_Day to Week Ending Sunday].[Week Ending Sunday], [Pivot DDS/Mbox Print Step2].[INSERT D], [Pivot DDS/Mbox Print Step2].CLIENT, [Pivot DDS/Mbox Print Step2].PRODUCT, [Pivot DDS/Mbox Print Step2].MARKET, [Pivot DDS/Mbox Print Step2].MEDI, [Pivot DDS/Mbox Print Step2].MEDIA, [Pivot DDS/Mbox Print Step2].[Pal Proxy], [Pivot DDS/Mbox Print Step2].Periodicity, [Pivot DDS/Mbox Print Step2].[Insert Dollars], [Pivot DDS/Mbox Print Step2].[Num Inserts], [Pivot DDS/Mbox Print Step2].PUBLICATION, [Pivot DDS/Mbox Print Step2].[Normalized Spend], [Pivot DDS/Mbox Print Step2].[Normalized Number of Inserts] FROM [Time_Lookup_Day to Week Ending Sunday] LEFT JOIN [Pivot DDS/Mbox Print Step2] ON [Time_Lookup_Day to Week Ending Sunday].Date = [Pivot DDS/Mbox Print Step2].[Normalized Date];
